actionConfiguration.body:
clientArray => {
  return clientArray.map(clientObject => {
    let object = {};
    for (const [key, value] of Object.entries(clientObject)) {
      if (["createdon", "modifiedon", "cr9c2_telephone", "test_mobile", "test_genre", "test_famille", "test_typedecommunication", "matserv_depot", "cr2b8_main_contact", "cr9c2_email", "cr9c2_name", "cr9c2_contact_clientid", "cr9c2_type_contact"].includes(key) == true) {
        object[key] = value;
      }
    }
    return object;
  });
}

